import styled from 'styled-components'

export const Radio = styled.input.attrs({
	type: 'radio',
})``

export const RadioLabel = styled.label`
	display: block;
	position: relative;
	padding-left: 35px;
	margin-bottom: 12px;
	cursor: pointer;
	font-size: 22px;
	-webkit-user-select: none;
	-moz-user-select: none;
	-ms-user-select: none;
	user-select: none;
`

export const Checkmark = styled.span``
